                        img: ",//white.jpeg",
                        name: "Maher",
                        role: "Ceo",
                        phone: "9023452323",
                        email: "tempsomeone@gmail.com",
                        website: "thewebsite.com",

                    }
                }
            />

        </div>

    )
}
export default Team
